import React from "react";

function App() {
  const todos =
    ({
      id: 1,
      completed: false,
      title: "Gym"
    }, {
      id: 2,
      completed: false,
      title: "Bike"
    }, {
      id: 3,
      completed: false,
      title: "Work"
    });

  return ( <
    div className = "wrapper" >
    <
    h1 > REACT < /h1> <
    TodoList todos = {
      todos
    }
    /> <
    /div>
  );
}

export default App;
